import Chart from '@assets/svg/Chart.svg';
import Document from '@assets/svg/Document.svg';
import Setting from '@assets/svg/Setting.svg';
import Location from '@assets/svg/Location.svg';
import Arrow from '@assets/svg/arrow-left.svg';

const line = () => {
    <div className="bg-watusi-250 w-full mt-2" style={{ height: '1px' }} />;
};

const filter = [
    { title: 'مشخصات فنی', icon: <Setting />, line: line },
    { name: 'برند', arrow: <Arrow />, line: line },
    { name: 'مدل', arrow: <Arrow />, line: line },
    { name: 'سال تولید', arrow: <Arrow />, line: line },
    { title: 'مکان خودرو', icon: <Location />, line: line },
    { name: 'استان', arrow: <Arrow />, line: line },
    { name: 'شهر', arrow: <Arrow />, line: line },
    { title: ' مشخصات فنی خودرو', icon: <Document />, line: line },
    { name: 'نوع خودرو', arrow: <Arrow />, line: line },
    { name: 'کیلومتر', arrow: <Arrow />, line: line },
    { name: 'گیربکس', arrow: <Arrow />, line: line },
    { name: 'سوخت', arrow: <Arrow />, line: line },
    { name: 'وضعیت بدنه', arrow: <Arrow />, line: line },
    { title: 'قیمت', icon: <Chart />, line: line },
];

export default filter;
